export const styled = (theme) => ({
    gridBooking: {
        padding: "15px",
    },
    choiceChair: {
        backgroundColor: "rgb(109, 238, 109)",
        color: "white",
        fontSize: "9px",
        width: "25px",
        height: "25px",
        border: "none",
        outline: "none",
        marginLeft: "2 %",
        marginBottom: "1 %",
        borderRadius: "5px",
        fontWeight: "500",
    },
    unChoiceChair: {
        backgroundColor: "#3e515d",
    },
    pading: {
        padding: theme.spacing(2),
    },
})
